import { useParams } from 'react-router-dom';
import ButtonGitHub from '../components/buttonGitHub/ButtonGitHub';
import { projects } from '../helpers/projectList';

import img from './../img/projects/01-big.jpg';

const ProjectDetail = () => {
    const {id} = useParams();
    const project = projects[id]

    return (
        <main className="section">
            <div className="container">
                <div className="project-details">

                    <h1 className="title-1">Video service</h1>
                    <p>{id}</p>

                    <img src={img} alt="" className="project-details__cover" />

                    <div className="project-details__desc">
                        <p>Skills: React, Node.js, MongoDB</p>
                    </div>

                    <ButtonGitHub link='https://github.com/MoonlightMediaGroup/my-portfolio-fullstack' />

                </div>
            </div>
        </main>
    );
}
 
export default ProjectDetail;
